export async function loadWobbleUpdater(engine, refresh = true) {
    await engine.addParticleUpdater("wobble", async (container) => {
        const { WobbleUpdater } = await import("./WobbleUpdater.js");
        return new WobbleUpdater(container);
    }, refresh);
}
